import React from 'react';

const Term = () => {
  return (
    <div
      style={{
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        height: '90vh'
      }}
    >
      <h1>Term</h1>
    </div>
  );
};

export default  Term;
